import React from 'react';
import './Menu.css';
import {NavLink} from 'react-router-dom';
import {connect} from 'react-redux';
import {close} from '../redux/actions/showModal';

const Menu = () => {
  return (
    <div className='menu'>
    <NavLink className='menu-item' to='/accounts'>Accounts</NavLink>
    <NavLink className='menu-item' to='/categories'>Categories</NavLink>
    <NavLink className='menu-item' to='history'>History</NavLink>

    </div>
  );
};

function mapStateToProps (state) {
  return {
    // flag: state.showModal,
  }
}

function mapDispatchToProps (dispatch) {
  return {
    summ: function(e) {
      dispatch(summ(e))
    },
    date: function(e) {
      dispatch(date(e))
    },

    close: function() {
      dispatch(close())
    },

  }
  }

export default connect(mapStateToProps) (Menu);
